import React from 'react'
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';


function Toastify({message}) {
    toast(message)
    return (
        <div>
            <ToastContainer />
        </div>
    )
}

export default Toastify
